import React from "react";
import spinner from "../../../src/img/Blocks-1s-200px.gif";
export default () => {
  return (
    <div>
      <iframe src="https://giphy.com/embed/VseXvvxwowwCc" width="480" height="480" frameBorder="0" class="giphy-embed" allowFullScreen></iframe><p><a href="https://giphy.com/gifs/VseXvvxwowwCc">via GIPHY</a></p>
      <img
        // src={spinner}
        style={{ width: "100px", margin: "auto", display: "block" }}
        alt="Loading..."
      />
    </div>
  );
};
